    "        conn.commit()\n",
    "        for i,row in news_df.iterrows():\n",
    "            #here %S means string values \n",
    "            \n",
    "            #print(\"No of records deleted: \", len())\n",
    "            sql2 = \"INSERT INTO stock.stock_news VALUES (%s,%s,%s,%s,%s)\"\n",
    "            cursor.execute(sql2, tuple(row))\n",
    "            print(\"Record inserted\")\n",
